import Display from './components/Display';
import Renderitems from './components/Renderitems';
import WatchList from './components/WatchList';
import { AuthProvider } from './context/AuthContext';

function App() {
  return (
    <div className="App">
     <BrowserRouter>
    <AuthProvider>
      <Routes>
        <Route />
      </Routes>
    </AuthProvider>

     </BrowserRouter>
    </div>
  );
}

export default App;
